import { Link, useNavigate } from "react-router-dom";
import { useEffect } from "react";
import { Button } from "react-bootstrap";
import React from "react";
import Table from "react-bootstrap/Table";
import userSession from "../../Service/userSession";
import OrderAPIService from "../../Service/OrderAPIService";

const OrderHistory = ({ isLoggedIn }) => {
  const navigate = useNavigate();
  useS

  useEffect(() => {
    if (!isLoggedIn) {
      navigate("/");
    } else {
      document.title = "History";
      // fetch API
      (true);
      OrderAPIService.orderHistory(
        { id: userSession.getUser().id },

      ).then((response)=>{
        if(response.status==200){
          // success
        }else{
          // internal error
        }
      }).catch((err)=>{
        ("Error while loading Order History..."); 

      });
      // UserApiService.registerUser(toBeAdded)
      //   .then((response) => {
      //     localStorage.removeItem("Loading");
      //     if (response.status === 201) {
      //       setLogIn(true);
      //       const userLoggedIn = {
      //         id: response.data,
      //         fname: firstName,
      //         lname: lastName,
      //         emailAddress: email,
      //         password: userPassword,
      //         phone:phone
      //       };
      //       userSession.addUser(userLoggedIn);
      //       handleClose();
      //       console.log("SUCCESS ON FRONT END ");
      //     } else {
      //       console.log("FAILURE ON FRONT END ");
      //     }
      //   })
      //   .catch((err) => {
      //     localStorage.removeItem("Loading");
      //     console.log("ERROR::: " + err);
      //   });
    }
  }, []);

  const toHomePage = () => {
    navigate("/");
  };

  const noHistory = () => {
    return (
      <section
        className="md-primary"
        style={{ fontFamily: "Signika", padding: "64px 32px" }}
      >
        <div
          className="container text-center"
          style={{
            marginRight: "auto",
            marginBottom: "340px",
            marginLeft: "auto",
          }}
        >
          <div style={{ marginTop: "40px" }}>
            {/* Image */}
            <img
              className="img-fluid"
              src={require("../../Resources/Vector/noHistory.png")}
              style={{ height: "60%", width: "50%" }}
            />
            {/* Help Text */}
            <div style={{ marginTop: "" }}>
              <p
                className=""
                style={{
                  fontSize: "2.5vw",
                  marginTop: "8.5vh",
                  marginBottom: "6.5vh",
                }}
              >
                Uh-Oh! Looks like you don't have any orders yet! Try our meals
                now!
              </p>

              {/* Order Button */}
              <div className="h-100 d-flex align-items-center justify-content-center">
                <Link to="/order">
                  <Button
                    variant="secondary"
                    className="text-primary"
                    style={{
                      height: "50px",
                      width: "150px",
                      borderRadius: "25px",
                      fontSize: "25px",
                    }}
                  >
                    Order
                  </Button>
                </Link>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  };

  const history = () => {
    return (
      <section
        className="bg-primary"
        style={{ fontFamily: "Signika", padding: "20% 32px" }}
      >
        <Table striped bordered hover style={{ fontSize: "calc(16px+1vw)" }}>
          <thead>
            <tr>
              <th>Meal Size</th>
              <th>Types of Meals</th>
              <th>Price</th>
              <th>Date Ordered</th>
              <th>Delivery Date</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((order) => {
              const { size, meals, price, orderDate, deliveryDate } = order;
              return (
                <tr>
                  <td>{size}</td>
                  {/* sorting might be expensive in run time*/}
                  <td>
                    {meals.sort().map((meal) => {
                      return (
                        <span>
                          {meal}
                          <br></br>
                        </span>
                      );
                    })}
                  </td>
                  <td>{price}</td>
                  <td>{orderDate}</td>
                  <td>{deliveryDate}</td>
                </tr>
              );
            })}
          </tbody>
        </Table>

        <div className="mt-4">
          If you would like to cancel your order, please email
          support@mirchimeals.com before 3pm the prior day of delivery.
        </div>
      </section>
    );
  };

  const viewOrderHistoryPage = () => {
    // userSession.getUser().orderHistory ? history() : noHistory();

    return (
      <>
        <div>Loading... </div>
      </>
    );
  };
  return <>{isLoggedIn ? viewOrderHistoryPage() : toHomePage()}</>;
};

export default OrderHistory;
